import { boxes } from "./Boxes";
import React from 'react';

export default function Practice() {
  const [arrayOfBoxes, setArrayOfBoxes] = React.useState(boxes);
  const jsxBoxes = arrayOfBoxes.map(box => <p style={box.on && { height: 100, width: 200 }}></p>);

  return (
    <div>
        { jsxBoxes }
    </div>
  );
};
